  return (
    <>
      <span>{data.suitName}</span>
      <span>{data.type}</span>
      <span>{data.against}</span>
      <span>{data.suitBuffName}</span>
      <span>{Array.from(eName).map(ele=> {
        return div
      })}</span>
    </>
  );
}
